import { Avatar, Button, Card } from 'antd';

const UserProfile = () =>{
    return(
        <Card>
            <div key="twit">쨱쨱         <br /> </div>
            <div key="followings">팔로잉 <br /> </div>
            <div key="follwers"  >팔로워 <br /> </div>
            <Card.Meta
            avatar={<Avatar>JS</Avatar>}
            title = "Joseph"
            />
            <Button>로그아웃</Button>
        </Card>
    )
}

export default UserProfile;
